import {createWebHistory, createRouter} from "vue-router";

const routes = [
    {
        path: "/",
        alias: "/professions",
        name: "professions",
        component: () => import("./components/ProfessionsList.vue")
    },
    {
        path: "/professions/:id",
        name: "profession-details",
        component: () => import("./components/./professionComponent")
    },
    {
        path: "/add",
        name: "add",
        component: () => import("./components/AddProfession.vue")
    }
];
const router = createRouter({
    history: createWebHistory(),
    routes,
});

export default router;
